column8:
ガラスの内側に使用するとエアコンを使用しなくても長時間くもりを防ぐコーティングタイプのくもり止めスプレーです。乱反射防止剤配合でギラギラを解消し、安全運転に役立ちます。　<br>
<br>

内容量 180ml <br>
備考 泡スプレー <br>
